import React from 'react';
import {connect} from "react-redux";
import '../style/global.css';

const mapStateToProps = (state) => {
  return {
    appState: state.appState
  }
};

const Dishy = (props) => {
  return(
    <div>
      <p>Dishy</p>
    </div>
  );
};

export default connect(mapStateToProps)(Dishy);
